function PopupWindow({ onSubmit, inputValue, onInputChange }) {
    return (
      <div className="popup-window">
        <form onSubmit={onSubmit}>
          <input type="text" value={inputValue} onChange={onInputChange} />
          <button type="submit">Submit</button>
        </form>
      </div>
    );
}
